import React, { useState, useEffect } from "react";
import Calendar from "./Calendar";

export default function Profile() {
  const [isLoading, setIsLoading] = useState(false);
  const [calendar, setCalendar] = useState([]);

  useEffect(() => {
    async function onLoad() {
      try {
        const profileCalendar = await loadCalendar();
        const calendar = profileCalendar;
        setCalendar(profileCalendar);
        console.log(calendar);
        console.log(profileCalendar);
      } catch (e) {
        console.log("error");
      }
    }
    onLoad();
  }, []);

  function loadCalendar() {
    return API.get("notes", "/calendar");
  }

  function updateCalendar(calendar) {
    return API.put("notes", "/calendar", {
      body: { calendar }
    });
  }

  async function handleSubmitCalendar(calendar) {
    setIsLoading(true);
    try {
      updateCalendar(calendar);
      setIsLoading(false);
    } catch (e) {
      console.log("error");
      setIsLoading(false);
    }
  }

  return (
    <div className="App">
      <div className="Calendar">
        <Calendar
          calendar={calendar}
          handleSubmitCalendar={handleSubmitCalendar}
        />
      </div>
    </div>
  );
}
